import React from "react";
import FundInfo from "./Fund_Info";
import MarketValue from "./MarketValue";
import Price from "./Price";
import UnrealizedPAndL from "./UnrealizedPAndL";

function Card() {
  return (
    <div className="card">
      <Price />
      <FundInfo />
      <MarketValue />
      <UnrealizedPAndL />
    </div>
  );
}

export default Card;
